import React, { useState } from 'react';
import Navbar from '../components/Navbar';
import './UserManagement.css';

const UserManagement = ({ user, onLogout }) => {
  const [users, setUsers] = useState([
    { id: 'A001', username: 'admin', role: 'Admin', status: 'Active', lastLogin: '2026-01-21' },
    { id: 'M001', username: 'manager', role: 'Manager', status: 'Active', lastLogin: '2026-01-20' },
    { id: 'E001', username: 'john.smith', role: 'Employee', status: 'Active', lastLogin: '2026-01-21' },
    { id: 'E002', username: 'sarah.johnson', role: 'Employee', status: 'Active', lastLogin: '2026-01-19' },
    { id: 'E003', username: 'mike.davis', role: 'Employee', status: 'Inactive', lastLogin: '2026-01-15' },
  ]);

  const toggleUserStatus = (id) => {
    setUsers(users.map(u => 
      u.id === id ? { ...u, status: u.status === 'Active' ? 'Inactive' : 'Active' } : u
    ));
  };

  const activeUsers = users.filter(u => u.status === 'Active').length;
  const inactiveUsers = users.filter(u => u.status === 'Inactive').length;

  return (
    <div className="users-page">
      <Navbar user={user} onLogout={onLogout} />
      
      <div className="users-container">
        <div className="users-header">
          <h1>User Management</h1>
          <button className="add-user-btn">+ Add New User</button>
        </div>

        <div className="users-stats">
          <div className="stat-card">
            <span className="stat-label">Total Users</span>
            <span className="stat-value">{users.length}</span>
          </div>
          <div className="stat-card active">
            <span className="stat-label">Active Users</span>
            <span className="stat-value">{activeUsers}</span>
          </div>
          <div className="stat-card inactive">
            <span className="stat-label">Inactive Users</span>
            <span className="stat-value">{inactiveUsers}</span>
          </div>
        </div>

        <table className="users-table">
          <thead>
            <tr>
              <th>User ID</th>
              <th>Username</th>
              <th>Role</th>
              <th>Status</th>
              <th>Last Login</th>
              <th>Action</th>
            </tr>
          </thead>
          <tbody>
            {users.map((u) => (
              <tr key={u.id}>
                <td>{u.id}</td>
                <td className="username">{u.username}</td>
                <td>
                  <span className={`role-badge role-${u.role.toLowerCase()}`}>
                    {u.role}
                  </span>
                </td>
                <td>
                  <span className={`status-badge ${u.status.toLowerCase()}`}>
                    {u.status}
                  </span>
                </td>
                <td>{u.lastLogin}</td>
                <td>
                  <button className="edit-btn">Edit</button>
                  <button 
                    className={`status-btn ${u.status.toLowerCase()}`}
                    onClick={() => toggleUserStatus(u.id)}
                  >
                    {u.status === 'Active' ? 'Deactivate' : 'Activate'}
                  </button>
                </td>
              </tr>
            ))}
          </tbody>
        </table>
      </div>
    </div>
  );
};

export default UserManagement;
